import React from 'react';
import { Stack, Typography } from '@mui/material';
import "./styles.css";

const HomePage = ()  => {
  return (
    <Stack
      direction="column"
      justifyContent="flex-start"
      alignContent="center"
      spacing={2}
      sx={{ p: 2 }}
    >
      <Typography variant="h2">
          Welcome to Jot
        </Typography>
        <Typography variant="subtitle1">
          Pick your canvas
        </Typography>
    </Stack>
  );
};

export default HomePage;
